import React from "react";


import Header from "./components/common/header";

import { SearchItems } from "./components/common/SearchItem";
import { FeaturedItems } from "./components/common/FeaturedItems";

const App: React.FC = () => {
  return (
    <div className="App">
      <Header />
      <FeaturedItems />
      <SearchItems />
    </div>
  );
};

export default App;
